import { Breadcrumb } from "flowbite-react";
import { HomeIcon } from '@heroicons/react/24/solid'
export default function(){
    return (
        <Breadcrumb aria-label="Default breadcrumb example" className="m-4 !text-xl">
            <Breadcrumb.Item
                href="#"
                icon={HomeIcon}
            >
                Главная
            </Breadcrumb.Item>
            <Breadcrumb.Item href="#">
                Слова
            </Breadcrumb.Item>
            <Breadcrumb.Item>
                Текущая
            </Breadcrumb.Item>
        </Breadcrumb>
    )
}
